import React, { Component } from "react";

class Header extends Component {
  render() {

    return (
      <header id="home">

          <ul style={{ listStyle: 'none', justifyContent: 'space-around'}}>
                        <li>Home</li>
                        <li>About</li>
                        <li>Contact</li>
                        <li>Service</li>
                          </ul>
      </header>
    );
  }
}

export default Header;
